<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Certificate</title>
    <style>
        @media print {
            body {
                -webkit-print-color-adjust: exact;
                /* Chrome, Safari */
                print-color-adjust: exact;
                /* Firefox */
            }
        }

        body {
            color: #fff;
            font-family: "Sitka Heading", Arial, sans-serif;
            background-color: #fff;
            margin: 0;
            padding: 0;
        }

        .certificate-container {
            position: relative;
            width: 100%;
            max-width: 900px;
            margin: 0px auto;
            padding: 0px;
            background-color: #ffffff;
            text-align: center;
            color: #fff;
        }


        .certificate-image {
            margin: 0;
        }

        .certificate-image img {
            max-width: 100%;
            height: auto;
        }

        .course {
            position: absolute;
            top: 150px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 2.5em;
            color: #fff;
            font-weight: bold;
        }

        .course-level {
            position: absolute;
            top: 231px;
            left: 39.7%;
            font-size: 0.93em;
            color: #fff;
        }


        .learner {
            position: absolute;
            top: 325px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 2.5em;
            color: #fff;
            font-weight: bold;
        }

        .date1 {
            position: absolute;
            top: 286px;
            left: 49%;
            font-size: 1em;
            color: #fff;
        }

        .date2 {
            position: absolute;
            top: 578px;
            left: 100px;
            font-size: 1em;
            color: #000;
        }

        .NSN {
            position: absolute;
            top: 578px;
            left: 745px;
            font-size: 1em;
            color: #000;
        }
    </style>
</head>
